function AdminDashboard() {
  return (
    <div>
      <h1>Admin Dashboard</h1>

      <ul>
        <li>Manage Services & Pricing</li>
        <li>Manage Staff & Schedules</li>
        <li>Approve / Reschedule Appointments</li>
        <li>View Sales & Booking Reports</li>
      </ul>
    </div>
  );
}

export default AdminDashboard;
